// Profile.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';

const Profile = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [gender, setGender] = useState('');
  const [dob, setDob] = useState('');
  const navigate = useNavigate();

  const handleSave = () => {
    // Save the data (you can implement saving logic here, e.g., updating a backend or local storage)
    alert('Profile details saved successfully!');
  };

  const goToTravelHistory = () => {
    navigate('/travel-history');
  };

  return (
    <div className="profile-page">
      <h2>MY PROFILE</h2>
      <div className="profile-container">
        <div className="profile-info">
          <label>Name:</label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} />

          <label>Email:</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />

          <label>Gender:</label>
          <input type="text" value={gender} onChange={(e) => setGender(e.target.value)} />

          <label>DOB:</label>
          <input type="date" value={dob} onChange={(e) => setDob(e.target.value)} />

          <button className="travel-history-btn" onClick={goToTravelHistory}>Travel History</button>
          <button className="save-btn" onClick={handleSave}>Save</button>
        </div>
        <div className="profile-photo-section">
          <div className="profile-photo-placeholder">
            {/* Placeholder for profile photo */}
            <img src="/path-to-placeholder-image.png" alt="Profile" className="profile-photo" />
          </div>
          <button className="edit-photo-btn">Edit</button>
        </div>
      </div>
    </div>
  );
};

export default Profile;
